import 'package:json_annotation/json_annotation.dart';part 'detail_rating_model.g.dart';@JsonSerializable()class DetailRatingModel {  @JsonKey(name: 'product_quality')  final int? productQuality;  @JsonKey(name: 'seller_service')  final int? sellerService;  @JsonKey(name: 'delivery_service')  final int? deliveryService;  @JsonKey(name: 'driver_service')  final int? driverService;  const DetailRatingModel({    this.productQuality,    this.sellerService,    this.deliveryService,    this.driverService,  });  factory DetailRatingModel.fromJson(Map<String, dynamic> json) =>      _$DetailRatingModelFromJson(json);  Map<String, dynamic> toJson() => _$DetailRatingModelToJson(this);}